import React, { useState, useEffect } from "react";
import axios from "axios";

const Swapi = () => {
  const [hero, setHero] = useState("");

  useEffect(async() => {

      const result = await axios('https://swapi.dev/api/people/1',);

    setHero(result.hero);
  }, [hero]);

  return <div>{
    hero}
    </div>;
};

export default Swapi;
